update t_im_school set introduction='北京市海淀区汽车驾驶学校（简称海淀驾校或海驾）成立于1985年，占地3000余亩，位于海淀区大西山旅游风景区。她背靠西山，东临京密引水渠，北接凤凰岭，南临旅游胜地大觉寺、鹫峰、阳台山。2010年政府投资兴建的旅游观光路横跨于海驾训练场上方。闲暇于观光路两侧凭眺，训练场内的教学车辆皆掩映绿树花草丛中。置身于天然氧吧中的学员不仅能学到驾驶技术，而且还能感受到一份久违地恬淡。
海淀驾校是场校合一的单位，不仅有训练场也有考试场。“京海考试场”不仅接纳海驾自己的学员考试，同时也为周边驾校学员提供考试服务。
“质量第一、信誉至上、创一流服务”是海驾办学的宗旨。为给学员创造良好的学习休息环境，学校备有健身器材、学员餐厅、休息室，海驾员工和学员分开就餐，以杜绝不正之风。篮球场、足球场也为海驾员工和学员提供了切磋球艺的场所
多年来，海淀驾校历任管理者不忘建校初衷，在市区两级政府相关部门支持下，不仅解决了北部地区剩余劳动力就业问题，同时又斥巨资对环境进行了治理，种植树木花草百余种、修缮排洪渠及周边道路，把原来的“河滩”变成了现在的“花园”。“春观碧桃、夏看紫薇、秋赏红叶、冬品白雪”，实现了“三季有花、四季常青”的环境治理目标，为学员和员工打造了“君在车中坐，车在画中游”的学习和工作环境。如今，围绕海驾周边形成了特有的产业链、生态圈，由此也促进了海淀北部地区的经济发展。同时，海驾以社会责任为己任，倡导文明驾驶、绿色出行。从自身做起，制定购置新能源汽车计划以降低碳排放，努力为北京的蓝天工程尽自己的一份力。
未来，海淀驾校将朝着智慧型驾校方向努力，与科技接轨，与自然亲近，利用大数据平台为学员服务，为社会培养优秀驾驶员，在新常态的环境下步入崭新的发展时代。' 
where id='ca21c0ca7f2c11e5b41980e6500868b4';





